  return (
    <div className="App">
      <header className="App-header">
        <DopComponent
          helloText={'My name is Alina'}
          isAdmin={true}
         // count={count}
        />
        <a className="App-link" href="https://youtu.be/2g811Eo7K8U" target="_blank" rel="noopener noreferrer">
          Посмотреть видео
        </a>
        <Button variant="outlined" color="primary"
          className="App-link"
         /*  href="https://reactjs.org" */
          href="https://youtu.be/2g811Eo7K8U"
          target="_blank"
          rel="noopener noreferrer"
        >
          Посмотреть видео
        </Button>
      </header>
    </div>
  );
}

export default App;
